import React from 'react';

// JSX - javascript XML

// funcion vai receber propriedades 

function Title(){
  return(
    <h1>Olá NLW3!!! Tudo certo agora!</h1>
  )
}


// toda vez que passa um atributo ( className="App" )para um componente
// chama isso de propriedade

function App() {
  return (
    <div className="App">
      <Title text="Título 1" />
      <Title text="Título 2" />
      <Title text="Título 3" />
      <Title text="Título 4" />
    </div>
  );
}

export default App;
